import "./Book.css";

export const Book = () => (
  <div class="bookpage">
    <div className="papa_book text-center">
      <div className="texto_book">
        <h2 className="h1 display-3">Our History</h2>
        <p>This</p>
      </div>
    </div>
  </div>
);
